export function ReceipesList() {
  const dispatch = useAppDispatch();
  const navigate = useNavigate();
  const recipes = useAppSelector(selectRecipes);
  const needsLoading = useAppSelector(selectNeedsLoading);

  if (needsLoading) {
    dispatch(retrieveRecipes());
  }

  const recipesEntries = recipes.map((recipe) => (
    <RecipeListEntry key={recipe.id} recipe={recipe} />
  ));

  function goToCreateRecipe() {
    return navigate("/create-recipe");
  }
  return (
    <div>
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" component="h1">
            Receipes List
          </Typography>
        </Toolbar>
      </AppBar>
      
      <List>{recipesEntries.length === 0 ? (<div>No recipe yet</div>) : recipesEntries}</List>

      <div className="fixed bottom-8 right-8">
        <Fab
          component="a"
          color="primary"
          aria-label="add"
          onClick={goToCreateRecipe}
        >
          <Add />
        </Fab>
      </div>
    </div>
  );
}
